import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Student from './components/Student';

function App() {
  return (
    <div className="App">

      <h1>Hello</h1> 

      <Header/>
      <Footer/>
      <Student id={101} name/>

    </div>
  );
}

export default App;
